const IncExpChart = ({ addInc, addAmount }) => {
  return (
    <div>
      <Bar
        data={{
          label: ["Income", "Expense"],
        }}
        width={100}
        height={500}
        color="aqua"
      />
    </div>
  );
};
export default IncExpChart;
